import React, { FunctionComponent, useEffect, useState } from 'react';
import { makeStyles, createStyles, Theme } from '@material-ui/core/styles';
import CSS from 'csstype';
import {fetch_suggestions} from '../services/http-requests'

import Grid from '@material-ui/core/Grid';
import Paper from '@material-ui/core/Paper';
import Typography from '@material-ui/core/Typography';
import ButtonBase from '@material-ui/core/ButtonBase';
import type { SearchObj} from '../types'

const useStyles = makeStyles((theme: Theme) =>
  createStyles({
    root: {

    },
    paper: {
      padding: theme.spacing(2),
      margin: '2px',
    },
    image: {
      width: 128,
      height: 128,
    },
    img: {
      margin: 'auto',
      display: 'block',
      maxWidth: '100%',
      maxHeight: '100%',
    },
  }),
);


export const Suggestion: FunctionComponent<SearchObj> = ({title ,n}: SearchObj)=> {
  const classes = useStyles();

  function get_suggestions(){
    fetch_suggestions(title,n)
    .then(response => {
      let data = response.data;
      console.log(data);

    })
    .catch((e) => {
      console.log(e);
    });
  }

  return <>
  <div style={containerStyle}>

  <Paper className={classes.paper}>
    <Grid container spacing={2}>
      <Grid item>
        <ButtonBase className={classes.image}>
          <img className={classes.img} alt="complex" src="/static/images/grid/complex.jpg" />
        </ButtonBase>
      </Grid>
      <Grid item xs={12} sm container>
        <Grid item xs container direction="column" spacing={2}>
          <Grid item xs>

            <Typography variant="body2" gutterBottom>
              Full resolution 1920x1080 • JPEG
            </Typography>
            <Typography variant="body2" color="textSecondary">
              ID: 1030114
            </Typography>
          </Grid>
          <Grid item>
            <Typography variant="body2" style={{ cursor: 'pointer' }}>
              Remove
            </Typography>
          </Grid>
        </Grid>
        <Grid item>
          <Typography variant="subtitle1">$19.00</Typography>
        </Grid>
      </Grid>
    </Grid>
    </Paper>
  </div>
  </>
}



const containerStyle: CSS.Properties = {
  // display: 'flex',
  // justifyContent: 'center',
};

const boxStyle: CSS.Properties = {
  backgroundColor: 'bisque'
};
